import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName('Create Product').getPropertyValue("response")
def holder=new XmlHolder(response)

//Store the Product Id as Custom Property at TestCase level
def productId= holder.getNodeValue("//*:id")
context.testCase.setPropertyValue("productID",productId)

//Verify whether the product is created successfully by validating the SKU, ProductName and ProductPrice in the service response
def sku, ExpectedSKU, productName, ExpectedProdName, productPrice, ExpectedProdPrice
//SKU validation
sku= holder.getNodeValue("//*:sku")
log.info sku
ExpectedSKU = context.expand('${Properties#SKU}')
assert(ExpectedSKU.equals(sku))

//Product Name validation
productName= holder.getNodeValue("//*:name")
log.info productName
ExpectedProdName = context.expand('${Properties#ProductName}')
assert(ExpectedProdName.equals(productName))

//Product Price Validation
productPrice= holder.getNodeValue("//*:price")
log.info productPrice
ExpectedProdPrice = context.expand('${Properties#ProductPrice}')
assert(ExpectedProdPrice.equals(productPrice))

//Verify whether the expected product is available in Get All Products service response based on Product ID
def response = context.testCase.getTestStepByName('Get All Products').getPropertyValue("response")
def ExpectedProductId = context.expand('${#TestCase#productID}')

if(response.contains(ExpectedProductId))
{
	log.info 'The product created is available in Products list'	
}
else
{
	log.info 'The product created is not available in Products list'	
}

