con:config.script:
import jxl.*
import com.eviware.soapui.model.testsuite.TestRunner.Status
def SKU, ProductName
def filepath = "C:/Users/DineshMohanasundaram/Documents/ProductsCatalog.xls"
File Excel = new File(filepath)
Workbook wb = Workbook.getWorkbook(Excel)
Sheet sh = wb.getSheet("Sheet1")

def rowsize = sh.getRows().toInteger();
def columnsize = sh.getColumns().toInteger();

log.info "$rowsize and $columnsize"

//loop over the required row and column size to get the test data(SKU, Product Name and Product Price) from excel
for(def i=1; i<rowsize; i++)
{
	for(def j=0; j<columnsize; j++)
{
				if(j==0)
				{
					SKU=sh.getCell(j,i).getContents()
					log.info "$SKU"
				}
				else if (j==1)
				{
					ProductName=sh.getCell(j,i).getContents()
					log.info "$ProductName"
				}
				else if (j==2)
				{
					ProductPrice=sh.getCell(j,i).getContents()
					log.info "$ProductPrice"
				}

}

// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["Catalog Product End-End Functional Testing"].testCases["Create Get Delete Product"]

// set credential properties from the script itself
tc.testSteps["Properties"].setPropertyValue("SKU", SKU)
tc.testSteps["Properties"].setPropertyValue("ProductName", ProductName)
tc.testSteps["Properties"].setPropertyValue("ProductPrice", ProductPrice)

// run test synchrouously
def runner = tc.run( null, false )

// show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

}

import com.eviware.soapui.model.testsuite.TestRunner.Status
def response = context.testCase.getTestStepByName('DataBase Connection').getPropertyValue("responseAsXml")

def SKU, ProductName, ProductPrice
def count = context.expand('${DataBase Connection#ResponseAsXml#count(//ResultSet/Row/PRODUCTS.SKU)}').toInteger();

//loop over the table rows to get the test data(SKU, Product Name and Product Price) from database
for(def i=1; i<=count; i++)
{
	SKU = context.expand('${DataBase Connection#ResponseAsXml#//ResultSet/Row['+i+']/PRODUCTS.SKU}')
	log.info SKU

	ProductName = context.expand('${DataBase Connection#ResponseAsXml#//ResultSet/Row['+i+']/PRODUCTS.NAME}')
	log.info ProductName

	ProductPrice = context.expand('${DataBase Connection#ResponseAsXml#//ResultSet/Row['+i+']/PRODUCTS.PRICE}')
	log.info ProductPrice

// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["Catalog Product End-End Functional Testing"].testCases["Create Get Delete Product"]

// set credential properties from the script itself
tc.testSteps["Properties"].setPropertyValue("SKU", SKU)
tc.testSteps["Properties"].setPropertyValue("ProductName", ProductName)
tc.testSteps["Properties"].setPropertyValue("ProductPrice", ProductPrice)

// run test synchrouously
def runner = tc.run( null, false )

// show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

}
